description:
Insider FT2 - CNC burg'ilash uskunasi sozlash vaqti nolga teng bo'lib, ishlab chiqarish vazifalarini izchil bajarishga imkon beradi. O'rnatilgan va demontaj qilingan mebel ishlab chiqaruvchilari va yarim tayyor mahsulotlar ishlab chiqaruvchilari uchun ideal uskuna.

Ikkita mustaqil harakatlanuvchi vagonga o'rnatilgan ikkita juft ishchi kallakning mavjudligi, har xil komponentlarning butun partiyasini qayta ishlashda shuningdek, murakkab turdagi burg'ilash operatsiyalarni ham juda tez bajarishga imkon beradi.

• nolga teng o'rnatish vaqti bilan har xil formatdagi panellarni qayta ishlash;
• ishlov berishning maksimal moslashuvchanligi bilan yuqori mahsuldorlik;
• zavod liniyasi bilan to'liq integratsiya.

SELCO WN 6 - bu yangi texnologiyalar bilan ishlab chiqilgan loyihaning natijasidir. Ohirgi texnik yechimlarni qo'llaydi va bu umumiy ishlov berish sifatini oshiradi. O'rta o'lchamli partiyalarni ishlab chiqarish uchun mo'ljallangan, bitta kesish chizig'iga ega bo'lgan professional arra uskunasi.

Raqamli boshqaruv yordamida yonma-yon joylashtirgichdan iborat yordamchi surish moslamasi. Qo'shimcha to'xtash kengligi 600 mm gacha bo'lgan chiziqlarni mustaqil ravishda kesish imkonini beradi.

• yuqori sifat va kesish aniqligi;
• asboblarni almashtirish vaqti kamaytirilgan;
• turli hildagi ishlov berish uchun texnologik yechimlar.
